    data: |
      SELECT - 63 AS col2 FROM tab1 (FORMAT parquet) WHERE NOT - ( - col1 ) + - col0 - + - col2 IN ( - col1 );
  - name: tab1

outputs:
  - name: q11243.out
    data: |
      -63
      -63
      -63
